import Expense from "./components/Expenses";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "toiletpaper",
      amount: 944,
      date: new Date(2020, 7, 14),
    },

    {
      id: "e2",
      title: "Car Insurances",
      amount: 2000,
      date: new Date(2020, 5, 13),
    },

    {
      id: "e3",
      title: "fooding",
      amount: 347,
      date: new Date(2020, 7, 23),
    },
    {
      id: "e4",
      title: "New Desktop(wooden)",
      amount: "4455",
      date: new Date(2020, 4, 11),
    },
  ];

  return (
    <div>
      <h2>Lets get started!</h2>
    </div>
  );
}
export default App;
